import { Card, Row } from 'antd';

function Post({ key, title, description }) {
  return (
    <Row style={{ justifyContent: 'center' }}>
      <Card
        key={key}
        title={title}
        hoverable={true}
        extra={<a href="#">More</a>}
        style={{ width: 300 }}
      >
        <p>{description}</p>
      </Card>
    </Row>
  );
}

export default Post;
